import React from "react"
import classes from "./NavbarStyles.module.css"
import logo from "../../Photos/LogoType.jpg"

export const NavBar = () => {
    return (
        <div className={
            classes.content
        }>
            <img border-radius="100%"
                src={logo}/>
            <div className={
                classes.title
            }>
                <p>Johanna</p>
                <p>Johanna</p>
                <p>Johanna</p>
            </div>
        </div>
    )
}
